import boto3
from airtable import Airtable
import base64


class Worker:
    def __init__(self):
        self.unique = 0
        self.isAuth = False
        self.userInfoTable = Airtable('appytOreQAh0kwjlt', "User Info", "key1B3UuMtQpUkWQS")
        self.designProjectTable = Airtable('appytOreQAh0kwjlt', "Design projects", "key1B3UuMtQpUkWQS")

    def get_all_journals(self, user):
        all_journals = []
        if self.isAuth:
            records = self.designProjectTable.search("UserName", user)
            for r in records:
                all_journals.append(r["fields"])
        return all_journals

    def get_single_journal(self, journalID):
        journal = {}
        if self.isAuth:
            fetched_journal = self.designProjectTable.search("JournalID", journalID)
            journal = fetched_journal[0]["fields"]
        return journal

    def recommendation_from_ml(self, text, title):
        pass

    def mood_from_ml(self, text, title):
        return 3

    def upload_to_s3(self, filename):
        s3 = boto3.client('s3')
        s3.upload_file(filename, 'sigmoidhack', filename)

    def post_journal(self, userID, username, date, title, journalText, journalImage):
        # Todo- get mood from backend
        # todo- update image url to cloud storage link
        if self.isAuth:
            filename = ""
            if journalImage:
                imgData = base64.b64decode(journalImage)
                filename = username + str(self.unique) + ".jpg"
                self.unique += 1
                with open(filename, 'wb') as f:
                    f.write(imgData)
            mood = self.mood_from_ml(journalText, title)
            self.upload_to_s3(filename)
            url = "https://sigmoidhack.s3.amazonaws.com/" + filename
            self.designProjectTable.insert({"UserID": userID, "UserName": username, "Date": date, "Title": title,
                                            "JournalText": journalText, "JournalImage":
                                                self.make_attachment(url), "Mood": mood})

    def post_login(self, username, password):
        if self.userInfoTable.search("Username", username) and self.userInfoTable.search("Password", password):
            self.isAuth = True
        return {"Success": self.isAuth}

    def post_signup(self, username, password):
        if not self.userInfoTable.search("Username", username):
            self.userInfoTable.insert({"Username": username, "Password": password, "Active": True})

    def post_deleteAccount(self, username, password):
        if self.userInfoTable.search("Username", username) and self.userInfoTable.search("Password", password):
            self.userInfoTable.delete_by_field("Username", username)
        # ToDO remove all journal entries in User Info

    def make_attachment(self, url):
        return [{'url': url}]


